import React, { Component } from 'react'
import { Input } from '@material-ui/core'

class Finance extends Component{

    state={
        name:"trewon",
        age:21,
    }

    onCLickHandle = (e) => {
        this.setState({
            name:e.target.value
        })
    }
    render(){
        return(
        <div>
            helloooooo i am finance
            {this.state.name}
            <p></p>
            <Input type="text" id="trewon" onChange={this.onCLickHandle}/>
        </div>

        )
    }
}

export default Finance
